import sunny from './sunny.png'
import './App.css';

function App() {
  return (
    <div className="App">
      <div className='deg-temp'>
            <img src={sunny} alt="" />
            <div className='top-degree'>62C</div>
      </div>
      <div>
          <div className='carenheigh'>F</div>
          <div className="celcius">C</div>
      </div>
    </div>
  );
}

export default App;
